n// in a way that updating styles of shared elements would only affect Phase1 pages.\nhtml {\n  font-size: 100%;\n}\n\nbody {\n  font-size: 100%;\n}\n\nh1, h2, h3 {\n  font-family: $barlowSemiCondensed-semibold;\n  margin-bottom: 1em;\n}\n\nh1 {\n  font-size: 3em;\n  line-height: 1.2;\n  color: $neutral-dark;\n}\n\nh2 {\n  color: $neutral-dark;\n  font-size: 2.125em;\n  line-height: 1.2;\n}\n\nh4 {\n  font-family: $barlowSemiCondensed-medium;\n  font-size: 1.5em;\n  line-height: 1.2;\n  margin-bottom: 1em;\n}\n\nh6 {\n  color: $neutral_dark;\n  font-size: 1em;\n  line-height: 1.2;\n  @include main-font-semi-bold;\n}\n\nh1, h2, h3, h4, h5, h6 {\n  margin-top: 0;\n}\n\na {\n  color: $brand_secondary_default;\n  text-decoration: underline;\n\n  &:hover {\n    color: $brand_secondary_dark;\n    text-decoration: underline;\n  }\n}\n\n.professional-learning-banner {\n  a {\n    text-decoration: none;\n  }\n}\n\n.header_right {\n  a {\n    text-decoration: none;\n  }\n}\n\n.tutorial-block, .courseblock-tall {\n  background-color: $neutral_light;\n}\n\np {\n  color: $neutral_dark;\n}\n\n#signin {\n  flex-grow: unset;\n}\n\n#signup {\n  p {\n    font-size: 14px;\n  }\n  a {\n    @include main-font-semi-bold;\n    font-size:  1em;\n  }\n\n  .signup {\n    input {\n      background-color: $neutral_light;\n    }\n\n    .signup-field-label {\n      label {\n        color: $neutral_dark;\n        @include main-font-semi-bold;\n        font-size: 1em;\n      }\n    }\n\n    .submit {\n      @include main-font-semi-bold;\n      padding: 10px 20px;\n      height: auto;\n      margin-right: 0;\n      background-color: $brand_secondary_default;\n      border: 2px solid $brand_secondary_default;\n      color: $neutral_white;\n\n      &:hover {\n        background-color: $brand_secondary_dark;\n        border-color: $brand_secondary_dark;\n        box-shadow: none;\n      }\n\n      &:focus {\n        border-color: $brand_primary_default;\n      }\n\n      &:disabled {\n        color: $neutral_white;\n        border-color: $neutral_dark20;\n        background-color: $neutral_dark20;\n        cursor: not-allowed;\n      }\n    }\n  }\n}\n\n#homepage-container {\n  .project_card {\n    > div {\n      background-color: $neutral_light !important;\n\n      &:hover {\n        border-color: $neutral_dark70 !important;\n      }\n    }\n\n    div {\n      color: $neutral_dark !important;\n\n      a:hover {\n        text-decoration: none;\n      }\n    }\n  }\n}\n\n#classroom-sections, #uitest-personal-projects {\n  table {\n    th {\n      color: $neutral_white !important;\n      background-color: $neutral_dark !important;\n\n      i {\n        color: $neutral_white !important;\n      }\n    }\n\n    td {\n      color: $neutral_dark;\n      background-color: $neutral_light;\n\n      i {\n        color: $neutral_dark;\n      }\n    }\n  }\n}\n\n.courseexplorer {\n  .grouprow {\n    background-color: $neutral_dark;\n\n    h6 {\n      color: $neutral_white;\n    }\n  }\n\n  .graderow {\n    background-color: $neutral_dark10 !important;\n\n    &.numbered {\n      color: $neutral_dark;\n    }\n  }\n\n  .courserow {\n    background-color: $neutral_dark70;\n  }\n\n  .arrow_box {\n    background-color: $neutral_white;\n\n    .arrow_box_content {\n      color: $neutral_dark;\n\n      .description {\n        font-size: 14px;\n\n        li, a {\n          font-size: 14px;\n        }\n      }\n\n      .description, a {\n        color: $neutral_dark;\n\n        a {\n          @include main-font-bold;\n          text-decoration: underline;\n          color: $brand_secondary_default;\n          &:hover {\n            color: $brand_secondary_dark;\n          }\n        }\n      }\n\n      .launch {\n        @include main-font-semi-bold;\n        font-size: 1em !important;\n        padding: 10px 20px;\n        height: auto;\n        margin-right: 0;\n        background-color: $brand_secondary_default;\n        border: 2px solid $brand_secondary_default;\n        color: $neutral_white;\n        line-height: unset;\n\n        &:hover {\n          background-color: $brand_secondary_dark;\n          border-color: $brand_secondary_dark;\n          box-shadow: none;\n        }\n\n        &:focus {\n          border-color: $brand_primary_default;\n        }\n\n        &:disabled {\n          color: $neutral_white;\n          border-color: $neutral_dark20;\n          background-color: $neutral_dark20;\n          cursor: not-allowed;\n        }\n      }\n\n      .course-explorer-gray-button {\n        @include main-font-semi-bold;\n        font-size: 1em !important;\n        color: $neutral_dark;\n        background-color: $neutral_white;\n        border: 2px solid $neutral_dark;\n        border-radius: 4px;\n        line-height: unset;\n\n        &:hover {\n          background-color: $neutral_dark10;\n          box-shadow: none;\n        }\n\n        &:focus {\n          border-color: $brand_primary_default;\n        }\n\n        &:disabled {\n          color: $neutral_dark20;\n          border-color: $neutral_dark20;\n          background-color: $neutral_white;\n          cursor: not-allowed;\n        }\n      }\n    }\n  }\n\n  .professional-learning {\n    background-color: $brand_primary_default;\n    color: $neutral_white;\n\n    .course-explorer-gray-button {\n      @include main-font-semi-bold;\n      font-size: .8em !important;\n      background-color: $brand_primary_default;\n      border: 2px solid $neutral_white;\n      border-radius: 4px;\n      color: $neutral_white;\n      box-shadow: none;\n      line-height: 30px;\n\n      &:hover {\n        background-color: $brand_primary_dark;\n        box-shadow: none;\n      }\n\n      &:focus {\n        border: 2px solid $brand_primary_default;\n      }\n\n      &:disabled {\n        color: $neutral_white;\n        border-color: $neutral_dark20;\n        background-color: $neutral_dark20;\n        cursor: not-allowed;\n      }\n    }\n  }\n}\n\n.hoc-overview-page {\n  color: $neutral_dark;\n  font-size: 14px;\n\n  h3 {\n    color: $neutral_dark;\n  }\n\n  .hoc-skinny-banner {\n    p {\n      color: $white;\n    }\n  }\n\n  > a {\n    color: $brand_secondary_default;\n  }\n\n  .tutorial-info {\n    background-color: $neutral_light;\n    border: 1px solid $neutral_dark20;\n\n    .tutorial-info-guide a {\n      color: $brand_secondary_default;\n    }\n  }\n\n  .full-resource-block {\n    border: 1px solid $neutral_dark20;\n\n    > a {\n      > img {\n        border: none !important;\n      }\n    }\n\n    .activities-info {\n      border-left: 1px solid $neutral_dark20;\n      background-color: $neutral_light;\n      color: $neutral_dark;\n\n      h2 {\n        color: $neutral_dark;\n      }\n    }\n  }\n\n  .tutorial-gray {\n    @include main-font-semi-bold;\n    font-size: 1em !important;\n    padding: 10px 16px;\n    height: auto;\n    margin-right: 0;\n    background-color: $brand_secondary_default;\n    border: 2px solid $brand_secondary_default;\n    color: $neutral_white;\n\n    &:hover {\n      background-color: $brand_secondary_dark;\n      border-color: $brand_secondary_dark;\n    }\n\n    &:focus {\n      border-color: $brand_primary_default;\n    }\n\n    &:disabled {\n      color: $neutral_white;\n      border-color: $neutral_dark20;\n      background-color: $neutral_dark20;\n      cursor: not-allowed;\n    }\n  }\n\n  .course-container {\n    .teacher-guide a {\n      color: $brand_secondary_default;\n    }\n  }\n}\n\n#projects-page {\n  .container {\n    .new-project-heading {\n      font-family: $barlowSemiCondensed-medium !important;\n      font-size: 1.5em !important;\n      line-height: 1.2 !important;\n    }\n\n    #uitest-public-projects {\n      .viewMoreLink {\n        &:hover {\n          text-decoration: underline;\n        }\n      }\n    }\n  }\n}\n\n.newProject-button-tile {\n  &:hover {\n    border-color: $neutral_dark70 !important;\n  }\n}\n\n.tutorial-promo-container.dance-party-container {\n  .tutorial-description {\n    color: $neutral_white;\n  }\n}\n\n.full-resource-block .resource-title {\n  // Overwrite global full-resource-block styling for phase1 styles\n  color: $neutral_dark !important;\n}\n\n.featured-project {\n  > a {\n    > div {\n      background-color: $neutral_light;\n    }\n  }\n}\n","// Common site-wide fonts, put here for easy access from all scss files\n\n// Please note (!): use only single quotes (' ') for strings (!) to allow our custom converter to work properly.\n// This file is being transpiled to js object.\n// (So it can be used in jsx/tsx files for inline styles. This is made mostly for legacy.\n// Try to avoid use of inline styles if you're creating new component).\n// Keeping that in mind -\n\n$metropolis-font: 'Metropolis';\n$noto-sans-fonts: 'Noto Sans', 'Noto Sans Arabic', 'Noto Sans Armenian', 'Noto Sans Bengali', 'Noto Sans SC',\n                  'Noto Sans TC', 'Noto Sans Devanagari', 'Noto Sans Georgian', 'Noto Sans Hebrew', 'Noto Sans JP',\n                  'Noto Sans Kannada', 'Noto Sans Khmer', 'Noto Sans KR', 'Noto Sans Myanmar', 'Noto Sans Sinhala',\n                  'Noto Sans Tamil', 'Noto Sans Telugu', 'Noto Sans Thai', 'Noto Sans Thaana';\n\n$main-font: $metropolis-font, $noto-sans-fonts, sans-serif;\n\n$thin-font-weight: 100;\n$extra-light-font-weight: 200;\n$light-font-weight: 300;\n$regular-font-weight: 400;\n$medium-font-weight: 500;\n$semi-bold-font-weight: 600;\n$bold-font-weight: 700;\n$extra-bold-font-weight: 800;\n$black-font-weight: 900;\n\n@mixin main-font-thin {\n  font-family: $main-font;\n  font-weight: $thin-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-thin-italic {\n  @include main-font-thin;\n  font-style: italic;\n}\n\n@mixin main-font-extra-light {\n  font-family: $main-font;\n  font-weight: $extra-light-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-extra-light-italic {\n  @include main-font-extra-light;\n  font-style: italic;\n}\n\n@mixin main-font-light {\n  font-family: $main-font;\n  font-weight: $light-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-light-italic {\n  @include main-font-light;\n  font-style: italic;\n}\n\n@mixin main-font-regular {\n  font-family: $main-font;\n  font-weight: $regular-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-regular-italic {\n  @include main-font-regular;\n  font-style: italic;\n}\n\n@mixin main-font-medium {\n  font-family: $main-font;\n  font-weight: $medium-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-medium-italic {\n  @include main-font-medium;\n  font-style: italic;\n}\n\n@mixin main-font-semi-bold {\n  font-family: $main-font;\n  font-weight: $semi-bold-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-semi-bold-italic {\n  @include main-font-semi-bold;\n  font-style: italic;\n}\n\n@mixin main-font-bold {\n  font-family: $main-font;\n  font-weight: $bold-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-bold-italic {\n  @include main-font-bold;\n  font-style: italic;\n}\n\n@mixin main-font-extra-bold {\n  font-family: $main-font;\n  font-weight: $extra-bold-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-extra-bold-italic {\n  @include main-font-extra-bold;\n  font-style: italic;\n}\n\n@mixin main-font-black {\n  font-family: $main-font;\n  font-weight: $black-font-weight;\n  font-style: normal;\n}\n\n@mixin main-font-black-italic {\n  @include main-font-black;\n  font-style: italic;\n}\n\n$barlowSemiCondensed-semibold: 'Barlow Semi Condensed Semibold', $noto-sans-fonts, sans-serif;\n$barlowSemiCondensed-medium: 'Barlow Semi Condensed Medium', $noto-sans-fonts, sans-serif;\n\n$code-font: 'Source Code Pro', Monaco, 'Bitstream Vera Sans Mono', 'Lucida Console', Terminal, monospace;\n\n/*\n   If you are changing the location of these files,\n   see the readme in this directory for more detail on manual steps to take when uploading new files.\n */\n$font-awesome-core-url: 'https://dsco.code.org/assets/font-awesome-pro/1684178876/css/fon